        "mainObject":"Маршрут 1: от Красной площади до гостницы «Украина» (Кутузовский проспект, 2/1,стр. 1): Подворье Саввино-Сторожевского монастыря, Тверская, 6, стр. 6 - Гостиница «Центральная», Тверская, 10 - Елисеевский магазин, Тверская, 14 - Музей - квартира А.М. Горького, Дом С.П. Рябушинского, Малая Никитская, 6/2 - Посольство Японии (с 1925 по 1945 год), Большая Никитская, 43 - Японское консульство в Москве во времена Российской Империи, Большая Молчановка, 15 Маршрут 2: от Музея Востока (Никитский бульвар, 12 а) до могилы Миякава Фунао (Новое Донское кладбище): Резиденция посла Японии, Калашный пер., 12 - Особняк Арсения Морозова, Дом дружбы с народами зарубежных стран (с 1959 года до конца 1990-х), Воздвиженка 16, стр.1.",
